import React from "react";
import { NavLink } from "react-router-dom";

export const MainHero = (): JSX.Element => {
  return (
    <section className="section-hero">
      <div className="hero_text">
        <h1 className="heading-primary">
          All the latest Movies, Shows and Documentaries
        </h1>
        <p className="hero_description">
          Browse the most trending media online all while sharing your favorite
          Movies, Shows and Documentaries with your friends and family online
        </p>
        <div className="action_buttons">
          <NavLink to="/">
            <button className="browse_media_button">Learn More</button>
          </NavLink>
        </div>
      </div>
      <div className="">modal</div>
    </section>
  );
};
